import React from 'react';
import Swiper from 'react-id-swiper'
import 'swiper/css/swiper.css';

const Home = () => {
    const params = {
        pagination: {
          el: '.swiper-pagination',
          type: 'bullets',
          clickable: true
        },
        navigation: {
          nextEl: '.swiper-button-next',
          prevEl: '.swiper-button-prev'
        },
        spaceBetween: 30
    }

    return(
        <Swiper {...params}>
                <div align="center"><img src="C:\Users\Seop\Documents\GitHub\FullStackProject-ing\Frontend\my-app\src\img\left1.jpg" alt="left1" title="left1"></img></div>
                <div>2</div>
                <div>3</div>
                <div>4</div>
        </Swiper>
    );
}

export default Home;
